import{_ as t}from"./chunks/v5__01.BTouU_wQ.js";import{_ as a}from"./chunks/debug_port_dsu7.Dgj2juP5.js";import{_ as o}from"./chunks/cuav_v5_debug_cable.CjGsjR_g.js";import{_ as r,c as i,a8 as l,o as n}from"./chunks/framework.BDnHobkS.js";const v=JSON.parse('{"title":"CUAV V5+ Autopilot","description":"","frontmatter":{},"headers":[],"relativePath":"en/flight_controller/cuav_v5_plus.md","filePath":"en/flight_controller/cuav_v5_plus.md"}'),s={name:"en/flight_controller/cuav_v5_plus.md"};function d(c,e,p,h,u,m){return n(),i("div",null,e[0]||(e[0]=[l('<h1 id="cuav-v5-autopilot" tabindex="-1">CUAV V5+ Autopilot <a class="header-anchor" href="#cuav-v5-autopilot" aria-label="Permalink to &quot;CUAV V5+ Autopilot&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 does not manufacture this (or any) autopilot. Contact the <a href="https://store.cuav.net/" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p><em>V5+</em><sup>®</sup> is an advanced autopilot manufactured by CUAV<sup>®</sup>. It was designed by CUAV<sup>®</sup> in collaboration with the PX4 team.</p><p>The autopilot is recommended for commercial systems integration, but is also suitable for academic research and any other use.</p><p><img src="'+t+'" alt="V5+ AutoPilot - hero image"></p><p>Some of its main features include:</p><ul><li>Full compatibility with the <a href="https://pixhawk.org/" target="_blank" rel="noreferrer">Pixhawk project</a> <strong>FMUv5</strong> design standard and uses the <a href="https://pixhawk.org/pixhawk-connector-standard/" target="_blank" rel="noreferrer">Pixhawk Connector Standard</a> for all external interfaces.</li><li>More advanced processor, RAM and flash memory than FMU v3, along with more stable and reliable sensors.</li><li>Firmware-compatible with PX4.</li><li>Modular design allows users to customize their own carrier board.</li><li>Built-in vibration dampening system with high performance shock absorption system.</li><li>Multiple-redundant sensor and power systems for improved flight safety and stability.</li></ul><div class="info custom-block"><p class="custom-block-title">INFO</p><p>This flight controller is <a href="./../flight_controller/autopilot_manufacturer_supported.html">manufacturer supported</a>.</p></div><h2 id="quick-summary" tabindex="-1">Quick Summary <a class="header-anchor" href="#quick-summary" aria-label="Permalink to &quot;Quick Summary&quot;">​</a></h2><ul><li><p>Main FMU Processor: STM32F765</p><ul><li>32 Bit Arm® Cortex®-M7, 216MHz, 2MB memory, 512KB RAM</li></ul></li><li><p>IO Processor: STM32F100</p><ul><li>32 Bit Arm® Cortex®-M3, 24MHz, 8KB SRAM</li></ul></li><li><p>On-board sensors:</p><ul><li>Accelerometer/Gyroscope: ICM-20689</li><li>Accelerometer/Gyroscope: BMI055</li><li>Magnetometer: IST8310</li><li>Barometer: MS5611</li></ul></li><li><p>Interfaces:</p><ul><li>8-14 PWM outputs (6 from IO, 8 from FMU)</li><li>3 dedicated PWM/Capture inputs on FMU</li><li>Dedicated R/C input for CPPM</li><li>Dedicated R/C input for Spektrum / DSM and S.Bus with analog / PWM RSSI input</li><li>analog / PWM RSSI input</li><li>S.Bus servo output</li><li>5 general purpose serial ports</li><li>4 I2C ports</li><li>4 SPI buses</li><li>2 CANBuses with serial ESC</li><li>Analog inputs for voltage / current of 2 batteries</li></ul></li><li><p>Power System:</p><ul><li>Power: 4.3~5.4V</li><li>USB Input: 4.75~5.25V</li></ul></li><li><p>Weight and Dimensions:</p><ul><li>Weight: 90g</li><li>Dimensions: 85.5*42*33mm</li></ul></li><li><p>Other Characteristics:</p><ul><li>Operating temperature: -20 ~ 80°c（Measured value）</li></ul></li></ul><h2 id="where-to-buy" tabindex="-1">Where to Buy <a class="header-anchor" href="#where-to-buy" aria-label="Permalink to &quot;Where to Buy&quot;">​</a></h2><p><a href="https://www.aliexpress.com/item/32890380056.html?spm=a2g0o.detail.1000060.1.7a7233e7mLTlVl&amp;gps-id=pcDetailBottomMoreThisSeller&amp;scm=1007.13339.90158.0&amp;scm_id=1007.13339.90158.0&amp;scm-url=1007.13339.90158.0&amp;pvid=d899bfab-a7ca-46e1-adf2-72ad1d649822" target="_blank" rel="noreferrer">CUAV Aliexpress</a> (International users)</p><p><a href="https://item.taobao.com/item.htm?spm=a1z10.5-c.w4002-21303114052.37.a28f697aeYzQx9&amp;id=594262853015" target="_blank" rel="noreferrer">CUAV Taobao</a> (China Mainland users)</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Autopilot may be purchased with included Neo GPS module</p></div><p><a id="connection"></a></p><h2 id="connections-wiring" tabindex="-1">Connections (Wiring) <a class="header-anchor" href="#connections-wiring" aria-label="Permalink to &quot;Connections (Wiring)&quot;">​</a></h2><p><a href="./../assembly/quick_start_cuav_v5_plus.html">CUAV V5+ Wiring Quickstart</a></p><h2 id="pinouts" tabindex="-1">Pinouts <a class="header-anchor" href="#pinouts" aria-label="Permalink to &quot;Pinouts&quot;">​</a></h2><p>Download <strong>V5+</strong> pinouts from <a href="http://manual.cuav.net/V5-Plus.pdf" target="_blank" rel="noreferrer">here</a>.</p><h2 id="voltage-ratings" tabindex="-1">Voltage Ratings <a class="header-anchor" href="#voltage-ratings" aria-label="Permalink to &quot;Voltage Ratings&quot;">​</a></h2><p><em>V5+ AutoPilot</em> supports redundant power supplies - up to three sources may be used: <code>Power1</code>, <code>Power2</code> and <code>USB</code>. You must supply power to at least one of these sources, or the flight controller will be unpowered.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>On FMUv5 based FMUs with PX4IO module (as is the case for the <em>V5+</em>), the Servo Power Rail is only monitored by the FMU. It is neither powered by, nor provides power to the FMU. However, the pins marked <strong>+</strong> are all common, and a BEC may be connected to any of the servo pin sets to power the servo power rail.</p></div><p><strong>Normal Operation Maximum Ratings</strong></p><p>Under these conditions all power sources will be used in this order to power the system:</p><ol><li><code>Power1</code> and <code>Power2</code> inputs (4.3V to 5.4V)</li><li><code>USB</code> input (4.75V to 5.25V)</li></ol><h2 id="over-current-protection" tabindex="-1">Over Current Protection <a class="header-anchor" href="#over-current-protection" aria-label="Permalink to &quot;Over Current Protection&quot;">​</a></h2><p>The <em>V5+</em> has over current protection on the 5 Volt Peripheral and 5 Volt high power, which limits the current to 2.5A. The <em>V5+</em> has short circuit protection.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>Up to 2.5 A can be delivered to the connectors listed as pin 1 (although these are only rated at 1 A).</p></div><h2 id="building-firmware" tabindex="-1">Building Firmware <a class="header-anchor" href="#building-firmware" aria-label="Permalink to &quot;Building Firmware&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Most users will not need to build this firmware! It is pre-built and automatically installed by <em>QGroundControl</em> when appropriate hardware is connected.</p></div><p>To <a href="./../dev_setup/building_px4.html">build PX4</a> for this target:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>make px4_fmu-v5_default</span></span></code></pre></div><h2 id="debug-port" tabindex="-1">Debug Port <a class="header-anchor" href="#debug-port" aria-label="Permalink to &quot;Debug Port&quot;">​</a></h2><p>The <a href="./../debug/system_console.html">PX4 System Console</a> and <a href="./../debug/swd_debug.html">SWD interface</a> operate on the <strong>FMU Debug</strong> port (<code>DSU7</code>). The board does not have an I/O debug interface.</p><p><img src="'+a+'" alt="Debug port (DSU7)"></p><p>The debug port (<code>DSU7</code>) uses a <a href="https://www.digikey.com.au/product-detail/en/jst-sales-america-inc/BM06B-GHS-TBT-LF-SN-N/455-1582-1-ND/807850" target="_blank" rel="noreferrer">JST BM06B</a> connector and has the following pinout:</p><table tabindex="0"><thead><tr><th>Pin</th><th>Signal</th><th>Volt</th></tr></thead><tbody><tr><td>1 (red)</td><td>5V+</td><td>+5V</td></tr><tr><td>2 (blk)</td><td>DEBUG TX (OUT)</td><td>+3.3V</td></tr><tr><td>3 (blk)</td><td>DEBUG RX (IN)</td><td>+3.3V</td></tr><tr><td>4 (blk)</td><td>FMU_SWDIO</td><td>+3.3V</td></tr><tr><td>5 (blk)</td><td>FMU_SWCLK</td><td>+3.3V</td></tr><tr><td>6 (blk)</td><td>GND</td><td>GND</td></tr></tbody></table><p>The product package includes a convenient debug cable that can be connected to the <code>DSU7</code> port. This splits out an FTDI cable for connecting the <a href="./../debug/system_console.html">PX4 System Console</a> to a computer USB port, and SWD pins used for SWD/JTAG debugging. The provided debug cable does not connect to the SWD port <code>Vref</code> pin (1).</p><p><img src="'+o+'" alt="CUAV Debug cable"></p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>The SWD Vref pin (1) uses 5V as Vref but the CPU is run at 3.3V!</p><p>Some JTAG adapters (SEGGER J-Link) will use the Vref voltage to set the voltage on the SWD lines. For direct connection to <em>Segger Jlink</em> we recommended you use the 3.3 Volts from pin 4 of the connector marked <code>DSM</code>/<code>SBUS</code>/<code>RSSI</code> to provide <code>Vtref</code> to the JTAG (i.e. providing 3.3V and <em>NOT</em> 5V).</p><p>For more information see <a href="#using-jtag-for-hardware-debugging">Using JTAG for hardware debugging</a>.</p></div><h2 id="serial-port-mapping" tabindex="-1">Serial Port Mapping <a class="header-anchor" href="#serial-port-mapping" aria-label="Permalink to &quot;Serial Port Mapping&quot;">​</a></h2><table tabindex="0"><thead><tr><th>UART</th><th>Device</th><th>Port</th></tr></thead><tbody><tr><td>UART1</td><td>/dev/ttyS0</td><td>GPS</td></tr><tr><td>USART2</td><td>/dev/ttyS1</td><td>TELEM1 (flow control)</td></tr><tr><td>USART3</td><td>/dev/ttyS2</td><td>TELEM2 (flow control)</td></tr><tr><td>UART4</td><td>/dev/ttyS3</td><td>TELEM4</td></tr><tr><td>USART6</td><td>/dev/ttyS4</td><td>TX is RC input from SBUS_RC connector</td></tr><tr><td>UART7</td><td>/dev/ttyS5</td><td>Debug Console</td></tr><tr><td>UART8</td><td>/dev/ttyS6</td><td>PX4IO</td></tr></tbody></table><p><a id="optional-hardware"></a></p><h2 id="peripherals" tabindex="-1">Peripherals <a class="header-anchor" href="#peripherals" aria-label="Permalink to &quot;Peripherals&quot;">​</a></h2><ul><li><a href="https://item.taobao.com/item.htm?spm=a1z10.3-c-s.w4002-16371268452.37.6d9f48afsFgGZI&amp;id=9512463037" target="_blank" rel="noreferrer">Digital Airspeed Sensor</a></li><li><a href="https://cuav.taobao.com/category-158480951.htm?spm=2013.1.w5002-16371268426.4.410b7a821qYbBq&amp;search=y&amp;catName=%CA%FD%B4%AB%B5%E7%CC%A8" target="_blank" rel="noreferrer">Telemetry Radio Modules</a></li><li><a href="./../sensor/rangefinders.html">Rangefinders/Distance sensors</a></li></ul><h2 id="supported-platforms-airframes" tabindex="-1">Supported Platforms / Airframes <a class="header-anchor" href="#supported-platforms-airframes" aria-label="Permalink to &quot;Supported Platforms / Airframes&quot;">​</a></h2><p>Any multicopter / airplane / rover or boat that can be controlled with normal RC servos or Futaba S-Bus servos. The complete set of supported configurations can be seen in the <a href="./../airframes/airframe_reference.html">Airframes Reference</a>.</p><h2 id="notes" tabindex="-1">Notes <a class="header-anchor" href="#notes" aria-label="Permalink to &quot;Notes&quot;">​</a></h2><h4 id="do-not-plug-digital-or-analog-pm-onto-connectors-configured-for-other-type-of-pm" tabindex="-1">Do not plug Digital or Analog PM onto connectors configured for other type of PM <a class="header-anchor" href="#do-not-plug-digital-or-analog-pm-onto-connectors-configured-for-other-type-of-pm" aria-label="Permalink to &quot;Do not plug Digital or Analog PM onto connectors configured for other type of PM&quot;">​</a></h4><p>If you plug an Analog PM into a digital PM connector it will stop all the I2C devices on that bus. Specifically this will stop the GPS&#39;s compass due to contention, and may also damage the FMU (longer term).</p><p>Similarly, a digital PM plugged into a analog connector will not work, and may also damage/destroy the power module (longer term).</p><h2 id="compatibility" tabindex="-1">Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;Compatibility&quot;">​</a></h2><p>CUAV adopts some differentiated designs and is incompatible with some hardware, which will be described below.</p><p><a id="compatibility_gps"></a></p><h4 id="gps-not-compatible-with-other-devices" tabindex="-1">GPS not compatible with other devices <a class="header-anchor" href="#gps-not-compatible-with-other-devices" aria-label="Permalink to &quot;GPS not compatible with other devices&quot;">​</a></h4><p>The <em>Neo v2.0 GPS</em> recommended for use with <em>CUAV V5+</em> and <em>CUAV V5 nano</em> is not fully compatible with other Pixhawk flight controllers (specifically, the buzzer part is not compatible and there may be issues with the safety switch).</p><p>The UAVCAN <a href="http://doc.cuav.net/gps/neo-series-gnss/en/neo-v2-pro.html" target="_blank" rel="noreferrer">NEO V2 PRO GNSS receiver</a> can also be used, and is compatible with other flight controllers.</p><p><a id="compatibility_jtag"></a></p><h4 id="using-jtag-for-hardware-debugging" tabindex="-1">Using JTAG for hardware debugging <a class="header-anchor" href="#using-jtag-for-hardware-debugging" aria-label="Permalink to &quot;Using JTAG for hardware debugging&quot;">​</a></h4><p><code>DSU7</code> FMU Debug Pin 1 is 5 volts - not the 3.3 volts of the CPU.</p><p>Some JTAG use this voltage to set the IO levels when communicating to the target.</p><p>For direct connection to <em>Segger Jlink</em> we recommended you use the 3.3 Volts of DSM/SBUS/RSSI pin 4 as Pin 1 on the debug connector (<code>Vtref</code>).</p><h2 id="known-issues" tabindex="-1">Known Issues <a class="header-anchor" href="#known-issues" aria-label="Permalink to &quot;Known Issues&quot;">​</a></h2><p>The issues below refer to the <em>batch number</em> in which they first appear. The batch number is the four-digit production date behind V01 and is displayed on a sticker on the side of the flight controller. For example, the serial number Batch V011904((V01 is the number of V5, 1904 is the production date, that is, the batch number).</p><p><a id="pin1_unfused"></a></p><h4 id="sbus-dsm-rssi-interface-pin1-unfused" tabindex="-1">SBUS / DSM / RSSI interface Pin1 unfused <a class="header-anchor" href="#sbus-dsm-rssi-interface-pin1-unfused" aria-label="Permalink to &quot;SBUS / DSM / RSSI interface Pin1 unfused&quot;">​</a></h4><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>This is a safety issue.</p></div><p>Please do not connect other equipment (except RC receiver) on SBUS / DSM / RSSI interface - this may lead to equipment damage.</p><ul><li><em>Found:</em> Batches V01190904xxxx</li><li><em>Fixed:</em> Batches later than V01190904xxxx</li></ul><h2 id="further-information" tabindex="-1">Further Information <a class="header-anchor" href="#further-information" aria-label="Permalink to &quot;Further Information&quot;">​</a></h2><ul><li><a href="http://manual.cuav.net/V5-Plus.pdf" target="_blank" rel="noreferrer">CUAV V5+ Manual</a></li><li><a href="http://doc.cuav.net/flight-controller/v5-autopilot/en/v5+.html" target="_blank" rel="noreferrer">CUAV V5+ docs</a></li><li><a href="https://docs.google.com/spreadsheets/d/1-n0__BYDedQrc_2NHqBenG1DNepAgnHpSGglke-QQwY/edit#gid=912976165" target="_blank" rel="noreferrer">FMUv5 reference design pinout</a></li><li><a href="https://github.com/cuav" target="_blank" rel="noreferrer">CUAV Github</a></li><li><a href="https://github.com/cuav/hardware/tree/master/V5_Autopilot/V5%2B/V5%2BBASE" target="_blank" rel="noreferrer">Base board design reference</a></li><li><a href="./../assembly/quick_start_cuav_v5_plus.html">CUAV V5+ Wiring Quickstart</a></li><li><a href="./../frames_multicopter/dji_f450_cuav_5plus.html">Airframe build-log using CUAV v5+ on a DJI FlameWheel450</a></li></ul>',71)]))}const S=r(s,[["render",d]]);export{v as __pageData,S as default};
